const d = document;

async function buscarConductor() {
  d.getElementById("datos-conductor").style.display = "block";
  d.getElementById("sin-datos").style.display = "none";

  const idChofer = d.getElementById("nro-conductor").value;
  const response = await fetch("./getDatosChofer.php", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({ id: idChofer }),
  });
  const chofer = await response.json();
  console.log(chofer);
  d.getElementById("ind_identificacion").textContent =
    chofer.conductorIdentificacion;
  d.getElementById("nombrec").textContent = chofer.conductorRazonSocial;
  d.getElementById("nro_conductor").textContent = chofer.conductorID;
  d.getElementById("descripcion_lic").textContent = chofer.tipoLicencia;
  d.getElementById("fecha_vencimiento_licencia").textContent =
    chofer.fechaVencimientoLicencia;
  d.getElementById("fecha_otorgada").textContent = chofer.fechaOtorgamiento;
  d.getElementById("fecha_vencimiento").textContent = chofer.fechaVencimiento;
  d.getElementById("observaciones").textContent = chofer.observaciones;
}

function buscarDatosConductor() {
  const ind_identificacion = d.getElementById("ind_identificacion").textContent;
  const nombrec = d.getElementById("nombrec").textContent;
  const nro_conductor = d.getElementById("nro_conductor").textContent;
  const descripcion_lic = d.getElementById("descripcion_lic").textContent;
  const fecha_vencimiento_lic = d.getElementById(
    "fecha_vencimiento_licencia"
  ).textContent;
  const fecha_otorgada = d.getElementById("fecha_otorgada").textContent;
  const fecha_vencimiento = d.getElementById("fecha_vencimiento").textContent;
  const tipo_cambio = d.getElementById("tipo_cambio").textContent;
  const fecha_ultimo_cambio = d.getElementById("tipo_cambio").textContent;

  imprimirHabilitacionChofer(
    ind_identificacion,
    nombrec,
    nro_conductor,
    descripcion_lic,
    fecha_vencimiento,
    fecha_otorgada,
    tipo_cambio
  );
}

function imprimirHabilitacionChofer(
  ind_identificacion = null,
  nombrec = null,
  nro_conductor = null,
  descripcion_lic = null,
  fecha_vencimiento = null,
  fecha_otorgada = null,
  tipo_cambio = null
) {
  const banner =
    "data:image/jpeg;base64,";
  const codigoqr =
    "data:image/jpg;base64,";
  const foto =
    "data:image/jpg;base64,";
  var doc = new jsPDF("p", "mm", "a4");
  //color
  doc.setFillColor(247, 247, 247);
  // borde. quitar F si no se quiere el color de fondo
  doc.rect(5, 5, 200, 148, "F");
  // banner
  doc.addImage(banner, "JPEG", 5, 5, 200, 32.2);
  // foto dni
  doc.addImage(foto, "JPEG", 160, 45, 40, 48.9);
  // código qr
  doc.addImage(codigoqr, "JPEG", 160, 100, 40, 40);

  // definición de constantes
  const subsecretaria = "Subsecretaría de Transporte y Tránsito";
  const municipalidad = "Municipalidad de Neuquén";
  const direccion = "Dirección General de Transporte";
  const verificacion = "Escanear QR para verificar datos.";

  // datos del usuario
  const nombre = nombrec;
  const dni = ind_identificacion;
  const credencial = nro_conductor;
  const renovacion = tipo_cambio;
  const taxi = descripcion_lic; // no se usa en el cartel o sí?
  const otorgada = fecha_otorgada;
  const vencimiento = fecha_vencimiento;
  const tipoVehiculo = "Remisse-QUIÉN PONE ESTO?";

  // posisionamiento de los datos
  doc.setFont("helvetica", "bold");
  doc.setFontSize(22);
  doc.text(15, 60, "DATOS DEL CONDUCTOR");
  doc.setFont("helvetica", "normal");
  doc.setFontSize(18);
  doc.text(15, 70, nombre);
  doc.text(15, 80, dni);
  doc.text(15, 90, "Credencial Nº: " + credencial);
  doc.text(85, 90, renovacion);
  doc.setFontSize(15);
  doc.text(15, 100, "Otorgada: " + otorgada);
  doc.text(85, 100, "Vencimiento: " + vencimiento);
  doc.text(15, 110, "Chofer: " + tipoVehiculo);
  doc.setFontSize(14);
  doc.text(15, 139, subsecretaria);
  doc.text(15, 145, direccion);
  doc.setFontSize(7.7);
  doc.text(160, 145, verificacion);

  doc.autoPrint({
    variant: "javascript",
  });
  doc.save("tashi.pdf");
}
